const Index = () => {
    return (
        <div>
            <header>
                <img width="100%" src="https://via.placeholder.com/450x300.png?text=Puppy+Placeholder"></img>
                <h1>My Divine Doodles</h1>
                <p>My Divine Doodles takes care of their family raised dogs and they take care of you.</p>
            
            </header>
            
        </div>
    )
}

export default Index
